class Solution:
    def maximalSquare(self, matrix) -> int:
        # # 暴力超时
        # if not matrix or not matrix[0]:
        #     return 0
        # n = len(matrix)
        # m = len(matrix[0])
        # k = min(m, n)
        # flag = 0
        # for i in range(k, -1, -1):
        #     for t in range(0, n - i + 1):
        #         for l in range(0, m - i + 1):
        #             cnt = 0
        #             for lis in matrix[t: t + i]:
        #                 if '0' in lis[l: l + i]:
        #                     flag = 1
        #                     break
        #                 else:
        #                     cnt += 1
        #             if flag:
        #                 flag = 0
        #                 continue
        #             if cnt == i:
        #                 return i ** 2

        # 动态规划
        # 这个动态规划的难点在于,matrix值为0的时候
        # 因为0的限制,不能更新其dp值
        if not matrix: return 0
        row = len(matrix)
        col = len(matrix[0])
        dp = [[0] * (col + 1) for _ in range(row + 1)]
        res = 0
        for i in range(1, row +1):
            for j in range(1, col + 1):
                if matrix[i - 1][j - 1] == "1":
                    dp[i][j] = min(dp[i-1][j - 1], dp[i - 1][j], dp[i][j - 1]) + 1
                    res = max(res, dp[i][j])
        return res ** 2


