# ############################### 229. 求众数 II #################################
# 要求算法的时间复杂度为 O(n)，空间复杂度为 O(1)。
x = [3,2,3]                 # [3]
x = [1,1,1,3,3,2,2,2]       # [1,2]
x = [1,1]       # [1,2]


# 和169题类似,用摩尔投票法
class Solution:
    def majorityElement(self, nums):
        if not nums:
            return []
        elif len(nums) == 1:
            return [nums[0]]
        require = len(nums) // 3
        candiate1 = candiate2 = None
        cnt1 = cnt2 = 0
        for num in nums:
            if num == candiate1:
                cnt1 += 1
            elif num == candiate2:
                cnt2 += 1
            elif cnt1 == 0:
                candiate1 = num
                cnt1 = 1
            elif cnt2 == 0:
                candiate2 = num
                cnt2 = 1
            else:
                cnt1 -= 1
                cnt2 -= 1

        cnt1 = cnt2 = 0
        for num in nums:
            if num == candiate1:
                cnt1 += 1
            elif num == candiate2:
                cnt2 += 1
        res = []
        if cnt1 > require:
            res.append(candiate1)
        if cnt2 > require:
            res.append(candiate2)
        return res
        # return [n for n in (candiate1, candiate2) if nums.count(n) > len(nums) // 3]


