# ############################### 230. 二叉搜索树中第K小的元素 #################################
# 进阶：
# 如果二叉搜索树经常被修改（插入/删除操作）并且你需要频繁地查找第 k 小的值，你将如何优化 kthSmallest 函数？
x = stringToTreeNode('[3,1,4,null,2]')
k = 1                       # 1

x = stringToTreeNode('[5,3,6,2,4,null,null,1]')
k = 3                       # 3


class Solution:
    def kthSmallest(self, root: TreeNode, k: int) -> int:
        # # 利用中序遍历升序,递归
        # res = [None, 0]
        #
        # def mid_order(root):
        #     if not root:
        #         return
        #     elif res[1] > k:
        #         return
        #     mid_order(root.left)
        #     res[1] += 1
        #     if res[1] == k:
        #         res[0] = root.val
        #         return
        #     mid_order(root.right)
        #
        # mid_order(root)
        # return res[0]

        # 利用中序遍历升序,迭代,迭代在提前终止剪枝时不会有问题,递归还是有多余的操作
        if root is None:
            return root

        stack = []
        container = []
        curr = root
        while curr or len(stack):
            if curr is not None:
                stack.append(curr)
                curr = curr.left
            else:
                node = stack.pop()
                container.append(node.val)
                if len(container) == k:
                    break
                curr = node.right
        return container.pop()


solve = Solution()
print(solve.kthSmallest(x, k))
